objet:
elaborer des études à caractère socio-économique (économie, finance, stratégie, ressources humaines), environnemental, climatique et autres à usage des partenaires sociaux nationaux de chaque Etat membre de l'U.E., et des fédérations européennes et au delà ; répondre à des appels à propositions et appels d'offres émanant d'institutions publiques nationales et européennes (Commission européenne) ; mettre en commun, en réseau fonctionnel, des ressources, et des compétences pour répondre à ces problématiques, notamment par la formation et la mise en commun de
ressources des travailleurs et de la défense de leurs intérêts, en particulier des représentants des entreprises et de participants au dialogue social ;
développer ces compétences à l'échelle de l'Union européenne ;
contribuer à développer l'expertise des comités d'entreprise européens ;
participer à la construction de l'Europe sociale comme définie dans les fondements de l'Union européenne, et développer une vision commune sur ce
